window.bookSummaryJSON = "<p><b>Enemies make dangerous lovers . . . or so they say.</b><br> <br> I am not a chosen of the Gods, but a bloody tragedy of their choices. I have endured worse than the Darkhavens. Torture. Pain. Manipulation. There is nothing anyone can do to me that I have not already done to myself.<br> <br> Ruen's betrayal will not break me. Despite the punishment I receive, my goal remains the same:<br> <br> Find the target. Terminate them. Free myself from the Underworld Assassination Guild.<br> <br> It doesn't matter if I let a single night of weakness bind me to one of them. I can't let it matter. They're all guilty in my eyes.<br> <br> Before I am done, they will learn I am <i>more</i>. I am the kiss of death.<br> <br> Contains mature themes.</p>"; 
